import React from 'react';

const MatchMenu = ({ matches }) => {
  return (
    <section className="p-4">
      <h2 className="text-xl font-bold mb-4">Maç Listesi</h2>
      <div className="grid gap-4">
      {matches.map((match) => (
        <div key={match.id} className="border p-4 flex flex-col sm:flex-row justify-between items-center">
          <div className="flex">
  <div className="flex items-center">
    {/* <img src={match.team1.logo} alt={match.team1} className="w-8 h-8 mr-2" /> */}
    <p className="text-lg font-bold">{match.team1}</p>
  </div>

  <div className="flex items-center mx-4">
    <p className="text-xl">{match.date}</p>
  </div>

  <div className="flex items-center">
    <p className="text-lg font-bold">{match.team2}</p>
    {/* <img src={match.team2.logo} alt={match.team2} className="w-8 h-8 ml-2" /> */}
  </div>

  {/* Ek bilgileri ekleyebilirsiniz */}
  {/* <p className="text-gray-500">{match.additionalInfo}</p> */}
</div>

          <div className="flex items-center">
            <button className='bg-blue-500 rounded-md px-4 py-2 text-white mr-2' onClick={() => console.log(`Maçı İncele: ${match.id}`)}>Maçı İncele</button>
            <button className='bg-green-500 rounded-md px-4 py-2 text-white' onClick={() => console.log(`Tahmin Üret: ${match.id}`)}>Tahmin Üret</button>
          </div>
        </div>
      ))}

      </div>
    </section>
  );
};



export default MatchMenu;
